import React from "react";
import Header from "../components/Header";
import Label from "../components/Label";
import { categorias } from "../data/categorias";

function Categorias() {
  return (
    <Header>
      {categorias.map((e) => {
        return <Label>{e.name}</Label>;
      })}
    </Header>
  );
}

export default Categorias;
